import React, { Component } from 'react';

export default class Form extends Component {
  render() {
    return (
      <form>
        <label htmlFor="name">
          Nome da carta:
          <input type="text" id="name" data-testid="name-input" />
        </label>
        <label htmlFor="textarea">
          Descrição da carta:
          <textarea id="textarea" data-testid="description-input" />
        </label>
      </form>
    );
  }
}
